script: |
  super -f text -I q6659.spq | sort > q6659.out

inputs:
  - name: q6659.spq
    data: |
      SELECT DISTINCT + col0 + + col2 * col2 + - - col0 AS col1 FROM tab1 (FORMAT parquet) WHERE NULL <= NULL AND 68 NOT IN ( + col2, 62, + 36 );
  - name: tab1

outputs:
  - name: q6659.out
    data: |
